# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.db.models.Model~Subclass
    - reversion_compare
    - Member[admin].Member[Revision]
  - - Django.db.models.Model~Subclass
    - reversion_compare
    - Member[admin].Member[Version]
  - - Django.db.models.Model~Subclass
    - reversion_compare
    - Member[compare].Member[ContentType]
  - - Django.db.models.Model~Subclass
    - reversion_compare
    - Member[compare].Member[Version]
  - - Django.db.models.Model~Subclass
    - reversion_compare
    - Member[compare_raw].Member[Version]
  - - Django.db.models.Model~Subclass
    - reversion_compare
    - Member[views].Member[Version]
